pragma solidity >=0.6.0;

contract DiamondHands {

    address owner;
    uint public developerFee;
    uint public devCommission;
    bool public pauseContract;
    address public newContractAddress;

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner(){
        require(msg.sender == owner);
        _;
    }

    modifier contractPaused(){
        require(pauseContract == true);
        _;
    }

    modifier contractNotPaused(){
        require(pauseContract == false);
        _;
    }

    struct account{
        address _address;
        uint _expiry;
        uint _lockedEth;
        bool _initialized;
    }

    mapping(address=>account) public accounts;
    
    function startAccount (uint _expiry) public payable contractNotPaused {
        require(msg.value>0, "No ETH sent");
        require(accounts[msg.sender]._initialized==false,"Account Already Exists");
        accounts[msg.sender] = account(msg.sender, _expiry, msg.value, true);
        uint commission = (msg.value*developerFee)/1000;
        devCommission+=commission;
        

    }
    function addToAccount () public payable contractNotPaused {
        require(msg.value>0);
        require(accounts[msg.sender]._initialized==true, "Account Does Not Exist");
        
        uint netAmount = accounts[msg.sender]._lockedEth+msg.value;
        accounts[msg.sender] = account(msg.sender, accounts[msg.sender]._expiry, netAmount, true);
        uint commission = (msg.value*developerFee)/1000;
        devCommission+=commission;
        

    }
    function withdrawETH() public {
        require(accounts[msg.sender]._initialized==true, "Account Does Not Exist");
        require(block.timestamp > accounts[msg.sender]._expiry, "Expiry Not Reached Yet");
        uint withdrawAmount = accounts[msg.sender]._lockedEth;
        address payable receiver = payable(msg.sender);
        if(receiver.send(withdrawAmount)){
            accounts[msg.sender] = account(msg.sender, 0, 0, false);
        }
        //require(payable(msg.sender).transfer(withdrawAmount),"Withdraw Transaction Failed");
        


    }

    function setNewOwner(address _owner) public onlyOwner {

        owner = _owner;

    }

    function setContractState(bool _state) public onlyOwner {

        pauseContract = _state;

    }

    function setNewContractAddress(address _address) public onlyOwner {

        newContractAddress = _address;

    }
    

    function setDevFee(uint _devFee) public onlyOwner contractNotPaused{

        developerFee = _devFee;

    }

    function withdrawDevCommission() public onlyOwner{
        address payable dev = payable(owner);
        require(devCommission>0, "Dev Commission is zero");

        if(dev.send(devCommission)){
            devCommission =0;

        }


    }


}
